import React from 'react';

export const ProfileImage = ({
  src,
  alt = "Profile image"
}) => {
  return (
    <div className="w-[33%] max-md:w-full">
      <img
        loading="lazy"
        src={src}
        alt={alt}
        className="object-contain w-full h-auto max-md:max-w-full"
      />
    </div>
  );
};
